import React from 'react';
import REturnTitle from './Title';
import './Balance.css';
import REturnDallArs from './Dollars';
import REturnFRanC from './Franc';
import REturnFRanCCuRRent from './Current';

import Media from 'react-media';


/// REturndAshBalAnce
export default function REturndAshBalAnce() {
 return (
  <div className='wrp-dash'>
   <REturnTitle />

   <Media
    queries={{
     small: '(max-width: 599px)',
     medium: '(min-width: 600px) and (max-width:1199px)',
     large: '(min-width: 1200px)',
    }}>
    {matches => (
     <>
      {matches.small && <ScreenSmall />}
      {matches.medium && <ScreenLarge />}
      {matches.large && <ScreenLarge />}
     </>
    )}
   </Media>

  </div>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-balance-dash'>
  <REturnDallArs />
  <REturnFRanC />
  <REturnFRanCCuRRent />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-balance-dash-sm'>
  <REturnDallArs />
  <REturnFRanC />
  <REturnFRanCCuRRent />
 </div>
);
